import React from 'react';

import { KeyboardDatePicker, OutlinedInput, FormControl, InputLabel } from '@material-ui/core';


const FormInput = ({ handleChange, label, ...props }) => (
    <FormControl variant="outlined">
        {label ? (
            <InputLabel htmlFor={label}>
                {label}
            </InputLabel>
        ) : null}

        <OutlinedInput id={label} onChange={handleChange} {...props} labelWidth={label.length > 5 ? label.length * 8 : 50} />
    </FormControl>
);

export const FormDate = ({ handleChange, label, ...props }) => (
    <KeyboardDatePicker
        margin="normal"
        id="date-picker-dialog"
        label="Date picker dialog"
        format="MM/dd/yyyy"
        onChange={handleChange}
        {...props} 
        KeyboardButtonProps={{
            'aria-label': 'change date',
        }}
    />
);


export default FormInput;
